    public List<ModelValue> getMetricsForAllModels() {
        final List<String> allMetricsForAllModels = new ArrayList<>();
        allMetricsForAllModels.addAll(BASELINES_MAPE);
        allMetricsForAllModels.addAll(VDP_PLUS_UNITS_MAPE);
        allMetricsForAllModels.addAll(VDP_UNITS_MAPE);
        allMetricsForAllModels.addAll(MATCHES);
        allMetricsForAllModels.addAll(LEGACY_MISMATCHES);
        allMetricsForAllModels.addAll(V2_MISMATCHES);

        List<ModelValue> allModelValues = new ArrayList<>();
        for (String batchOfMetrics : allMetricsForAllModels) {
            String[] allModelsMetrics = batchOfMetrics.split(DELIMITER_FOR_EACH_MODEL);
            for (String metricForSingleModel : allModelsMetrics) {

                // System.out.println("raw=" + metricForSingleModel);

                List<Metric> metricsForSingleModel = new ArrayList<>();
                if (StringUtils.isNotBlank(metricForSingleModel) && !metricForSingleModel.equals("><") && !metricForSingleModel
                        .contains("GetMetricDataResponse")) {

                    // System.out.println("raw=" + metricForSingleModel);

                    String model = getStringInTheMiddle(metricForSingleModel, LABEL.getStarting(), LABEL.getFinishing());
                    // System.out.println("MODEL=" + model);
                    List<String> values = getNodes(metricForSingleModel, VALUE.getStarting(), VALUE.getFinishing());
                    List<String> timestamps = getNodes(metricForSingleModel, START_TIME.getStarting(), START_TIME.getFinishing());
                    Iterator<String> iter1 = values.iterator();
                    Iterator<String> iter2 = timestamps.iterator();

                    while (iter1.hasNext()) {
                        String valForSingleModel = iter1.next();
                        String timestampForValueForSingleModel = iter2.next();

                        // System.out.println("model=" + model + " value=" + valForSingleModel + " timestamp=" +
                        // timestampForValueForSingleModel);
                        metricsForSingleModel.add(new Metric(timestampForValueForSingleModel, valForSingleModel));
                    }

                    allModelValues.add(new ModelValue(model, metricsForSingleModel));
                }
            }
        }

        for (ModelValue modelValue : allModelValues) {
            for (Metric metric : modelValue.getValues()) {
                //System.out.println("[model] model=" + modelValue.getMetricName() + " timestamp=" + metric.getDate() + " value=" + metric
                  //      .getValue());
            }
        }

        return allModelValues;
    }

    @Getter
    @AllArgsConstructor
    private static class ModelValue {
        private final String metricName;
        private final List<Metric> values;
    }

    @Getter
    @AllArgsConstructor
    private static class Metric {
        private final String date;
        private final String value;
    }

    private static List<String> getNodes(final String strToAnalize, final String before, final String after) {
        int numberOfOccurrences = StringUtils.countMatches(strToAnalize, before);

        String subString = strToAnalize;
        List<String> values = new ArrayList<>();
        for (int i = 0; i < numberOfOccurrences; i++) {
            String val = getStringInTheMiddle(subString, before, after);
            subString = StringUtils.substringAfter(subString, after);
            values.add(val);
        }

        return values;
    }

    private void pupulateContainers(@NonNull final List<ModelValue> allMetricsForAllModels) {

        for (ModelValue modelValueInstance : allMetricsForAllModels) {

            String modelName = StringUtils.substringAfter(modelValueInstance.getMetricName(), "LaunchMetrics-").split("-")[0];// <TODO
            modelNameToSamples.computeIfAbsent(modelName, model -> new ArrayList<>());
            modelNameToSamples.get(modelName).add(modelValueInstance);

            if (modelValueInstance.getMetricName().contains("BaselineMape")) {
                if (isAccepted(modelValueInstance, ACCEPTED_MAPE)) {
                    acceptedBaselinesMape.add(modelValueInstance);
                }
            } else if (modelValueInstance.getMetricName().contains("VdpPlusUnitsMape")) {
                if (isAccepted(modelValueInstance, ACCEPTED_MAPE)) {
                    acceptedVdpPlusUnitsMape.add(modelValueInstance);
                }
            } else if (modelValueInstance.getMetricName().contains("VdpUnitsMape")) {
                if (isAccepted(modelValueInstance, ACCEPTED_MAPE)) {
                    acceptedVdpUnitsMape.add(modelValueInstance);
                }
            } else {
                // These are not MAPE so we do not care
            }
        }
    }

