    private static String getStringInTheMiddle(final String strToAnalize, final String before, final String after) {

        //System.out.println("raw=" + strToAnalize);
        String tentativeSubstr = StringUtils.substringAfter(strToAnalize, before);
        //System.out.println("tentativeSubstr=" + tentativeSubstr);

        return StringUtils.substringBefore(StringUtils.substringAfter(strToAnalize, before), after);
    }

    private static boolean isAccepted(@NonNull final ModelValue modelValueInstance, final double threshold) {
        if (Double.parseDouble(modelValueInstance.getValues().get(modelValueInstance.getValues().size() - 1).getValue()) < threshold) {
            return true;
        }
        return false;
    }

